import { AlipayCircleOutlined, TaobaoCircleOutlined, WeiboCircleOutlined } from '@ant-design/icons';
import React, {Component, Fragment} from "react"
import {  Form, Input, Icon,  Button, Checkbox, Select, Tabs }  from'antd'

import {withRouter} from "react-router-dom" 

const {Item} = Form
const {TabPane} = Tabs

class Login extends Component{
    constructor(props){
        super(props);
    }
    render(){
        const layout = {
            labelCol: {
              xs: { span: 24, offset: 12},
              sm: { span: 24, offset: 12},
            },
            wrapperCol: {
              xs: { span: 6, offset: 0 },
              sm: { span: 6, offset: 0 },
            },
          };
          const tailLayout = {
            wrapperCol: {
              offset: 10,
              span: 16,
            },
          };
        const { getFieldDecorator } = this.props.form;
        return (
            <Form
            {...layout}
            name="basic"
            style= {{marginTop: 200}}

          >
              <Tabs defaultActiveKey="1" style = {{marginLeft: 300}}>
                  <TabPane tab="Admin" key="1" >
                  <Form.Item>
                    {getFieldDecorator('username', {
                        rules: [{ required: true, message: 'Please input your username!' }],
                    })(
                        <Input
                        prefix={<Icon type="user" style={{ color: 'rgba(0,0,0,.25)' }} />}
                        placeholder="Username"
                        />,
                    )}
                    </Form.Item>


                        <Form.Item>
                    {getFieldDecorator('password', {
                        rules: [{ required: true, message: 'Please input your Password!' }],
                    })(
                        <Input
                        prefix={<Icon type="lock" style={{ color: 'rgba(0,0,0,.25)' }} />}
                        type="password"
                        placeholder="Password"
                        />,
                    )}
                    </Form.Item>

                  </TabPane>
                  <TabPane tab="Non-admin" key="2">
                      <h3>hello</h3>
                  </TabPane>
              </Tabs>



            <Item {...tailLayout}>
              <Button type="primary" htmlType="submit" onClick = {this.onClick}>
                Submit
              </Button>
            </Item>
          </Form>
        )
    }
}
export default Form.create({ name: 'normal_login' }) (withRouter(Login));
